if (window.screen.width < 768) {
  var navigation = document.querySelector('.main-navigation');
  var button = document.querySelector('#menu-toggler').content.cloneNode(true).children[0];
  navigation.insertAdjacentElement('beforebegin', button);
  document.body.classList.add('menu-hidden');
  button.addEventListener('click', function () {
    if (document.body.classList.contains('menu-hidden')) {
      document.body.classList.remove('menu-hidden');
      button.innerHTML = "\n        <svg width=\"18\" height=\"15\">\n          <use xlink:href=\"/images/stack.svg#close\" />\n        </svg>\n      ";
      return;
    }
    document.body.classList.add('menu-hidden');
    button.innerHTML = "\n      <svg width=\"18\" height=\"12\">\n        <use xlink:href=\"/images/stack.svg#menu\" />\n      </svg>\n    ";
  });
}

